description:
A collection of sets from the now defunct love-rachel.com (1-15, 17, 20, 22). While the site is down, the lovely vixen lives on through a few faithful (if scarcely supported) torrents and galleries. I was late to the party, but still have more than the average number of sets that's around the internet nowadays. I know there are a number of people wanting these too, so here you are. :)

